function Footer() {
  return (
    <footer>
      <div className="footer-content">
        <p>Â© 2023 VoiceForHer. All rights reserved.</p>
        <div className="social-media-icons">
          <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">
